pragma solidity >= 0.5.15  < 0.6.0;

contract MultisigRDA {
    address[3] private participants;

    enum TransactionType {ReturnDeposit, PayDamages, Migrate}
    struct Transaction {
        uint16 id;
        address owner;
        TransactionType tp;
        address target;
        bool[3] confirmations;
        uint256 value;
    }
    uint16 transactionCounter = 0;
    mapping(uint16 => Transaction) public transactions;

    function createTransaction(TransactionType tp, address target, uint256 value) public {
        uint16 _id = transactionCounter++;
        bool[3] memory _confirmations;
        for (uint i=0; i<3; i++) {
            if (participants[i] == msg.sender) {
                _confirmations[i] = true;
                break;
            }
        }

        Transaction memory _tx = Transaction(_id, msg.sender, tp, target, _confirmations, value);
        transactions[_id] = _tx;
    }

    constructor(address one, address two, address three) public {
        participants = [one, two, three];
    }

    function getAccs() public view  returns (address[3] memory) {
        return participants;
    }

}
